import React, { useState } from 'react';
import {
  Card, CardContent, Typography, Grid, TextField, MenuItem, FormControlLabel,
  Checkbox, Button, Alert, Stack
} from '@mui/material';
import { apiPost } from './api';

export default function AddCitizenForm() {
  const [form, setForm] = useState({
    nationalId: '',
    fullName: '',
    dateOfBirth: '',
    gender: '',
    areaName: '',
    areaType: '',
    householdAddress: '',
    isHead: false,
    hasCriminalRecord: false,
    setWanted: false,
    setQuanChe: false
  });
  const [msg, setMsg] = useState('');
  const [err, setErr] = useState('');

  const change = (e) => {
    const { name, type, value, checked } = e.target;
    setForm(f => ({ ...f, [name]: type === 'checkbox' ? checked : value }));
  };

  const submit = async (e) => {
    e.preventDefault();
    setMsg(''); setErr('');
    try {
      const data = await apiPost('/api/citizens', form);
      setMsg(`Thêm thành công (CitizenID: ${data?.data?.CitizenID ?? 'N/A'})`);
      setForm({
        nationalId: '', fullName: '', dateOfBirth: '', gender: '',
        areaName: '', areaType: '', householdAddress: '',
        isHead: false, hasCriminalRecord: false, setWanted: false, setQuanChe: false
      });
    } catch (error) { setErr(error.message); }
  };

  return (
    <Card>
      <CardContent>
        <Typography variant="h6" gutterBottom>Nhập thông tin</Typography>
        <form onSubmit={submit}>
          <Stack spacing={2}>
            {msg && <Alert severity="success">{msg}</Alert>}
            {err && <Alert severity="error">{err}</Alert>}

            <Grid container spacing={2}>
              <Grid item xs={12} sm={6}>
                <TextField label="CCCD" name="nationalId" value={form.nationalId}
                           inputProps={{ maxLength: 12 }}
                           onChange={change} required fullWidth/>
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField label="Họ tên" name="fullName" value={form.fullName}
                           onChange={change} required fullWidth/>
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField label="Ngày sinh" name="dateOfBirth" type="date"
                           InputLabelProps={{ shrink: true }}
                           value={form.dateOfBirth} onChange={change} fullWidth/>
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField select label="Giới tính" name="gender" value={form.gender}
                           onChange={change} fullWidth>
                  <MenuItem value="">--Chọn--</MenuItem>
                  <MenuItem value="Nam">Nam</MenuItem>
                  <MenuItem value="Nữ">Nữ</MenuItem>
                  <MenuItem value="Khác">Khác</MenuItem>
                </TextField>
              </Grid>
              <Grid item xs={12}>
                <TextField label="Khu vực (Area Name)" name="areaName"
                           value={form.areaName} onChange={change} required fullWidth/>
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField select label="Loại khu vực (Area Type)" name="areaType"
                           value={form.areaType} onChange={change} required fullWidth>
                  <MenuItem value="">--Chọn--</MenuItem>
                  <MenuItem value="Thôn">Thôn</MenuItem>
                  <MenuItem value="Tổ">Tổ</MenuItem>
                </TextField>
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField label="Địa chỉ hộ" name="householdAddress"
                           value={form.householdAddress} onChange={change} required fullWidth/>
              </Grid>
              <Grid item xs={12} sm={6}>
                <FormControlLabel control={
                  <Checkbox name="isHead" checked={form.isHead} onChange={change} />
                } label="Chủ hộ" />
              </Grid>
              <Grid item xs={12} sm={6}>
                <FormControlLabel control={
                  <Checkbox name="hasCriminalRecord" checked={form.hasCriminalRecord} onChange={change} />
                } label="Có tiền án/tiền sự" />
              </Grid>
              <Grid item xs={12} sm={6}>
                <FormControlLabel control={
                  <Checkbox name="setWanted" checked={form.setWanted} onChange={change} />
                } label="Gắn Truy nã" />
              </Grid>
              <Grid item xs={12} sm={6}>
                <FormControlLabel control={
                  <Checkbox name="setQuanChe" checked={form.setQuanChe} onChange={change} />
                } label="Gắn Quản chế" />
              </Grid>
            </Grid>

            <Button type="submit" variant="contained" size="large">Thêm công dân</Button>
          </Stack>
        </form>
      </CardContent>
    </Card>
  );
}
